import ToDoApp from './ToDoApp'

const weatherData = {
  currentCity: "Cleveland",
  description: "Sunny",
  temperature: 76
}

function App() {
  return (
    <div>
      Hello React
      <ToDoApp name="Tim" weather={weatherData} />
    </div>
  );
}

export default App;
